import React, { Component } from "react";
import './app.css'
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

class App extends Component {
    render(){
        let div = (
            <p>Hello World</p>
        )
        return(
            <div>
                <Row>
                    <Col className="wrapper">
                        {div}
                    </Col>
                </Row>
            </div>
        )
    }
}

export default App;
